import './Buttons.css';

const CloseButton = (props) => {
    return (
        <button className='close-button'>
            <svg clasName='close-btn-icon' stroke="currentColor" fill="currentColor" stroke-width="0" viewBox="0 0 24 24" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"><path fill="none" stroke="#000" stroke-width="2" d="M3,3 L21,21 M3,21 L21,3"></path></svg>
        </button>
    )
};

export default CloseButton;
